import styled from 'styled-components';
import AllL from '../../assets/All.png';

export default function section() {
  return (

      <Section>
        <Topic>
          <Ttext>Topics</Ttext>
          <Line />
          <InSections>
            <MenuItem>
              <Itemlogo />
              All
            </MenuItem>
            <MenuItem>
              <Itemlogo />
              Education
            </MenuItem>
            <MenuItem>
              <Itemlogo />
              Technology
            </MenuItem>
            <MenuItem>
              <Itemlogo />
              Social
            </MenuItem>

          </InSections>
        </Topic>
      </Section>

  );
}
const Section = styled.section`
display: flex;
flex-direction: column;
align-items: flex-start;
padding: 41px 15px;

position: absolute;
width: 192px;
height: 464px;
left: 40px;
top: 136px;

/* Background */

background: #FAF8F9;
`;
