color: Black;

position: static;
width: 162px;
height: 30px;`;
const Itemlogo = styled.div`
position: static;
width: 17.37px;
height: 17.37px;
left: 0px;
top: 5px;
background-image: url(${AllL});


/* Inside Auto Layout */

flex: none;
order: 0;
flex-grow: 0;
margin: 0px 11px;
`;
